import '../App.css';

const coursesList = [
	{
		title: '',
		description: '',
		image: '',
		link: '',
	},
];

class Courses extends React.Component {
	CoursesList = () => {
		return <div></div>;
	};
	render() {
		return (
			<div className='courses'>
				<h3>My Courses</h3>
				<this.CoursesList />
			</div>
		);
	}
}

export default Courses;
